custombutton.initcode:
this.locked = "data:image/png;base64,"
this.unlocked = "data:image/png;base64,";

var uri = makeURI("data:text/css," + encodeURIComponent(this.Help));
var sss = Cc["@mozilla.org/content/style-sheet-service;1"].
          getService(Ci.nsIStyleSheetService);
if (!sss.sheetRegistered(uri, sss.USER_SHEET)) {
  sss.loadAndRegisterSheet(uri, sss.USER_SHEET);
}

this.toggleLock = function() {
  var tabbrowser = document.getElementById("content");
  tabbrowser.hidden = !tabbrowser.hidden
  cbu.ps.setBoolPref(prefName, tabbrowser.hidden);
  this.image = tabbrowser.hidden ? this.locked : this.unlocked;
}

var prefName = "custombuttons.lockBrowser";
var lock = false;
try {
  lock = cbu.ps.getBoolPref(prefName);
} catch(ex) {}

lock && this.toggleLock();
